import React, {Component} from "react";
import "./contacts.css";
import mapboxgl from "mapbox-gl";
import 'mapbox-gl/dist/mapbox-gl.css';
import home from "./img/home.png";
import phone from "./img/phone.png";
import email from "./img/email.png";

class Contacts extends Component{
    constructor(props){
        super(props)

        this.mapToken = "pk.eyJ1IjoiYmFsZWV2IiwiYSI6ImNsYXBqNmk4dTE5Y3UzcWxiYmt1bTJtcG8ifQ.aE8lRdfDnWq52szIP7gAHw"
        this.map = null
    }

    componentDidMount(){
        mapboxgl.accessToken = this.mapToken;
        this.map = new mapboxgl.Map({
            container: "map",
            style: 'mapbox://styles/mapbox/satellite-streets-v1',
            center: [38.670901, 47.276988],
            zoom: 16,
            minZoom: 2,
            attributionControl: false,
            interactive: false
        })
    }

    render(){
        return(
            <div className="contacts">
                 <div className="contacts_top">
                    <div id="map"></div>
                    <ul className="contacts_cont">
                        <li className="header_cont">
                            <span>Свяжитесь с нами</span>
                        </li>
                        <li>
                            <img src={home}/>
                            <span>Ростовская область, Неклиновский район, с. Носово, ул. Мира, 33</span>
                        </li>
                        <li>
                            <img src={phone}/>
                            <span>+7 (928) 607 30-60</span>
                        </li>
                        <li>
                            <img src={email}/>
                            <span>spk50let@mail.ru</span>
                        </li>
                    </ul>
                 </div>
                 <div className="contacts_callback">

                 </div>
            </div>
        )
    }
}

export default Contacts
